var minimizedMaximum = function(n, quantities) {
  let sum = 0;
  let max = 1;
  for(let q of quantities){
      sum+=q;
      if(q > max) {
          max = q;
      }
  }
  // console.log(sum);
  // return sum;
  let avg = Math.ceil(sum/n);
  let newN = 0;  
  let hm = new Map();
  while(newN !== n){
      let newN = getXDistribution(quantities, avg);
      if(newN === n){
          return avg;
      }
      if(newN < n){
          return avg;
          avg--;
          // if(hm.has(avg)){
          //   return ++avg;
          // } else{
          //   hm.set(avg);
          // }
      } else{
          avg++;
          // if(hm.has(avg)){
          //   return --avg;
          // } else{
          //   hm.set(avg);
          // }
      }
      console.log(newN, avg)
  }
  return avg;
};
var getXDistribution = function (quantities, avg){
  let newN = 0;
  for(let q of quantities) {
      newN += Math.ceil(q/avg);
  }
  return newN;
}

